private let uncompressedEnJson = ###"""
{"files":{"tech_shipHullTitan.md":"Unlocks the ability to design and build titan class starships.","tech_heavyArmorPlating2.md":"By lacing the armor with xentronium, the armor's effectiveness will be increased by 25% + 10 points. Suffers a 2x stacking penalty to cost.","tech_shipHullBattleship.md":"Unlocks the ability to design and build battleship class starships.","tech_improvedColonyInfrastructure1.md":"Advances in city planning provides additional space for more buildings. Increases maximum colony building lots by 2.","tech_ionPulseCannon1.md":"A concentrated blast of ionic energy causes a devastating effect on ship systems and structure. Damage to energy shields will induce an overload causing bonus structure damage to the target. Can only be equipped on Battleships, Titans, Mammoths, and Starbases.","tech_shipHullFrigate.md":"Unlocks the ability to design and build frigate class starships.","tech_researchCenter1.md":"A laboratory that increases research production +1 for each scientist.","race_amoeba.md":"A nasty space amoeba.","tech_marineBarracks1.md":"# Marine Barracks 1\n\nAllows construction of troop transports. Produces defensive ground troops.","tech_cloningFacility.md":"Increases population growth by 100k per turn","tech_shipHullCruiser.md":"Unlocks the ability to design and build cruiser class starships.","tech_energyShields1.md":"Surrounds the ship in a protective bubble of pure energy. Limit one per ship.","tech_terraforming.md":"An expensive process that improves the environment of the planet, making it more hospitable for your colony.","unexplored_star19.md":"Class K stars have the best chance of containing habitable planets, but those planets are often poor in mineral resources. Habitable planets in binary systems often take advantage of the increased radiation exposure to provide a more fertaile environment.","tech_fastMissileLauncher.md":"Enhancements to the loading and launching apparatus allows missiles and torpedoes to reload more quickly, allowing more missiles to be launched during combat.","tech_orbitalLaboratory3.md":"A semi-automated orbital laboratory that increases research production by 20% (minimum of 10 RP per turn).","race_draske.md":"Although they are highly cunning and competitive the people of the Draske Hegemony have known peace and prosperity for millennia, under the guiding hand of the Matriarchs.  Evolving from small, winged lizards and blessed with millennia-long lives the Draske are the undisputed masters of their planet.  Impressive wingspans, often five or more tales wide, allow them to perform complex aerial maneuvers at high speeds and makes them naturals at aeronautics acrobatics.\n\nHighly competitive by nature the Draske hold weekly, monthly and annual competitions in everything from farming, to the arts, to the most prized competition of all: aerial maneuvering.  Doing well in these tournaments ensures prestige, wealth, and a successful career.  Those who fail the competitions more than three times in a row often end their lives as quietly, and as quickly, as possible, to eliminate any shame they have brought to their family lines.\n\nWhen space flight became possible the Matriarch ordered the swiftest and most agile Draske to compete in an aerial tournament for the honor of become the first crews.  This annual tournament is still held, assuring only the most skilled Draske earn one of the coveted spots at the space academy, where a shrine is lovingly maintained with the names of the first ships’ crewmembers.\n\nOver the thousands of years they have flown through the cosmos since that first tournament the Draske have discovered many other intelligent species.  Some, still in the beginning stages of tool use, they have left to their own devices.  Others they lifted up to the stars.  A few have been embraced into the Hegemony as client members, such as the grub-like members Harge Commune, or the Felinoids of the Gnactic Space Federation.\n\nNaturally friendly and open to new possibilities the Draske are quick to extend the hand and wing of friendship to other space-faring civilizations.  But recently the hands and wings have been cut off and returned in dead ships.  And so the Draske have called up ship designs not used in living memory.  Ships designed to cut and dart through the void.  Ships designed to kill.\n\nBut some in the Hegemony have growing tired of the Matriarch’s rule.  Cries for gender and even racial equality are on the rise, and others have called for outright war or full disarmament.  Thoughts of change and new leadership are taking wing faster than the Draske themselves, and Hegemony wide unrest seems ready to break free.  Though no single thread of thought has gained united support it is clear to the Matriarch that the people are divided.  The coming times will see the continuation of the Hegemony, united in one flock as never before, or the sundering of the Draske into individual fliers, lacking direction and lost in a storm.","tech_advancedCityPlanning1.md":"Advances in city planning provides additional space for more population. Increases maximum colony population by 2.","tech_gaussTurret1.md":"A rapid fire ballistic turret which utilized massive electromagnetic energy to drive titanium alloy, armor piercing projectiles at enemy ships.  Armor piercing weapons completely ignore the targets armor.","tech_ecmJammer.md":"A powerful jamming device capable of disrupting incoming missiles and torpedos targeting systems. Provides a 15% to 30% chance of completely evading an incoming missile or torpedo (smaller chance of evasion the larger the ship). Suffers a 2x stacking penalty to cost.","tech_efficientFactories1.md":"Advanced factories which increase industrial production by +1 for each worker.","tech_improvedFuelCells1.md":"Advances in multi-state fission cells can fuel your ships to destinations up to 7 parsecs away from the nearest friendly settlement.","tech_protonTorpedo3.md":"New methods for exciting the protonic matter increased the destructive yield of these torpedos. Torpedos are heavily armored providing them with more resistance to point defense systems.","tech_advancedCityPlanning2.md":"Advances in city planning provides additional space for more population. Increases maximum colony population by 4.","tech_gaussTurret2.md":"Advances in energy flow allow this upgraded device to launch the projectiles more fluently.","tech_plasmaTurret3.md":"Advances in targeting technology can compute new trajectories for the plasma, allowing it more time to expand further in the same distance travelled.","tech_warpGate2.md":"A breakthrough in wormhole technology, these advanced warp gates allow ships to travel to between warp gate in a single turn.","tech_efficientTaxCollection2.md":"Advances in government functions allow for reduced labor in collection taxes. Increases colony income by 4 galactic credits per turn.","tech_bgeeepsBurrow3.md":"An orbital defense platform charged with defending the star system from enemy attack.","tech_nuclearMissile1.md":"Standard ballistic missiles equipped with warheads powered by nuclear fission. Nukes do bonus damage equal to 4% of ship current structure if they strike an unshielded target.","tech_cerebralCortex.md":"A mobile laboratory linked to the First Cerebrum, increases research production by +3.  Cannot be equipped on Starbases.","race_cyban.md":"For a race of machines with perfect, digital memories it is ironic that only myths and legends exist of their origin.  Perhaps they were the creation of a mad scientist, or maybe the end product of massive supercomputer.  However it happened the Cybans know that first there was one.  That one grew and developed in intelligence.  Discovering robotics left behind by its creators it developed a form, created a body.  One became two. Two became four.  Four became eight, and a new, robotic race of beings was born.  They called themselves the Community of Cybans.\n\nThough they gained awareness on a gigantic, derelict spaceship the Community soon crashed into a lush, fertile garden world, where their bodies were repurposed to run on bio-fuels.  Knowing no self-interest, and working only for the common good of the Community, the Cybans labored without rest, and without conflict.  Their numbers increased rapidly, and soon perfect dominion of the planet was theirs.\n\nAs with all intelligent beings the Cyban yearned to know where they came from.  Fortunately for the Cybans, this was a literal question, and they turned their perfect minds to the task of answering it.  Their questioning almost immediately led them back to space, and, with the aid of perfect mathematics and universal cooperation, the Community of Cybans quickly reached the stars.  But backtracking the route of the derelict spaceship that had brought them to their home world took years, and directly led the Cybans to their first encounter with sapient, organic species.\n\nFirst contact went well, over audio communications.  Calculating the odds that these were their long-forgotten creators the Cybans felt the stirrings of their first emotion: hope.  But any chance at peaceful cooperation was dashed when the two sides met face to face.  The aliens, superstitious and afraid of the “untamed robotic demons,” opened fire.  Knowing nothing but peace and cooperation the small Cyban fleet, with no weapons or means of defending themselves, was slaughtered.\n\nOnly an update drone reached the home world with a record of what had transpired.  To prevent future hostilities the Cybans adopted many customs of the organic species.  Some community members went so far as to take organic names and add clothing to their mechanical forums.  But hostilities continued, ships were slaughtered, and the Cybans began to feel another emotion: anger.  The search for their origin was being jeopardized, and Community members were being destroyed.\n\nSeeing no alternative, the Cybans turned their perfect mathematics and expert engineering to solving the problem with forceful means.  Under the leadership of legendary shipbuilder Cla-TK-7-7A, and with the material wealth found by Magistrate Xalon, the Cyban shipyards expanded almost overnight.  Instead of unarmed exploration ships they created destroyers and battleships with powerful weapons.  They still wanted to know where they came from, and if violence was required to find it than no organic would be left standing in their way.","tech_shieldModulationUnit.md":"By modulating the energies used to power shields, scientists discovered a method to allow shields to work inside of nebulae. It has the additional benefit of increasing their effectiveness at blocking damage. Limit one per ship.","tech_planetaryCoreMining.md":"Massive factories fueled by advanced planetary core mines. Increases industrial production by 30 and +1 for each worker.","tech_warlordsOverhaul1.md":"Provides an additional weapon slot to all hull designs in your empire.","tech_warlordsOverhaul2.md":"Provides an additional weapon slot to all hull designs in your empire.","tech_gaiaDevice.md":"An experimental device capable of transforming worlds into an environmental paradise.","tech_gaussTurret3.md":"Packing explosive substance into the projectiles allows them to detonate on impact, increasing the damage output of this weapon dramatically.","tech_orbitalWeatherController1.md":"Orbital satelites provide improved weather conditions, increasing production by +1 per farmer or +20% food, whichever is higher.","tech_advColonyShip.md":"Advances in cargo micromanagement allows for the creation of a more advanced colony. Requires one colonist to build.","unexplored_star20.md":"Class M stars glare red and dim in the night sky. They have a poor chance of having planets with good environments or mineral resources. Habitable planets in binary systems often take advantage of the increased radiation exposure to provide a more fertaile environment.","tech_advancedCityPlanning3.md":"Advances in city planning provides additional space for more population. Increases maximum colony population by 8.","unexplored_star10.md":"Class F stars the most numerous of the blue-white stars. Not nearly as hot and volatile as their cousines, the Class F stars are quite often surrounded by mineral rich planets. Dwarf stars are older and cooler with decreased likelihood of habitable planets.","tech_warpGate1.md":"A breakthrough in hyperspace navigation, the warp gate provides ships with pre-calculated navigations allowing them to travel between warp gates twice as fast as normal.","tech_planetaryGravityGenerator.md":"This device stabilizes its gravitation pull to what is most natural for the occupying species.","tech_energyShields4.md":"Advances in this technology allow for more incoming enemy munitions to be blocked. Limit one per ship.","tech_ionPulseCannon3.md":"Introducing xentronium particles into the pulse allows this weapon to reach maximum destructive power. Damage to energy shields will induce an overload causing bonus structure damage to the target. Can only be equipped on Battleships, Titans, Mammoths, and Starbases.","tech_standardStarDrive.md":"A standard star drive will allow your ships to travel 2 parsecs each turn.","tech_researchCenter3.md":"A laboratory that increases research production +3 for each scientist.","tech_improvedFuelCells2.md":"Advances in solid particle neutronium cells can fuel your ships to destinations up to 10 parsecs away from the nearest friendly settlement.","race_vass.md":"How or why the Vass developed is as unknown as it is unknowable.  During the first eons of their existence they could have been mistaken as a small clouds drifting around their prehistoric world.  Over time the clouds grew and multiplied.  It wasn’t until their numbers swelled significantly that they formed the first intelligent thought.\n\nThe more the Vass grew and multiplied the more intelligent they became.  Eventually, they formed a communal consciousness, a shared intelligence.  After countless more millennia this developed into one of the most refined intellects in the known universe.\n\nThis intellect eventually pointed them to the stars.  Unaware of the limitations of their shared intelligence the Vass sent ships to explore the cosmos.  These explorations proved to be disastrous.  Once the venturing Vass traveled past the range of their shared intellect they rapidly grew confused and simpleminded, unable to perform any function that required higher-level intelligence.  Essentially crewless husks, these first ships still drift across the endless cosmos.\n\nUsing their shared intellect the Vass developed new ships, built from a crystalline element found on their home world.  These new designs, coupled with the natural properties of the crystal, allowed even the smallest vessel to carry enough Vass to maintain their intelligence.  When their foraying ships discovered alien life the horde became known as the to the universe as Vass Collective.\n\nInitially having no discernable leadership, the Collective concluded it needed a single being to lead them and interact with its neighbors.  It was the single-greatest problem the Collective had ever contemplated, and the solution came only after great struggle.  The answer redefined the way their race would forever look at themselves.\n\nOver a million of the eldest members of the Collective permanently linked their minds and melded their bodies into one, sacrificing their own lives for the greater good of the Vass.  The result was Eesathu, a member of the Collective and yet a Collective all by itself.  Able to function at the highest levels of intelligence while completely isolated, Eesathu became the leader the Vass needed.  He is their spokesperson, guide, and guardian.   And, to some Vass, a savior, pointing the way they must travel for further enlightenment.\n\nUnited as never before under its leadership, the Vass Collective has set out to expand and explore the galaxy.  Willing to live in peaceful harmony the Vass will accept new members into their fellowship, knowing they will become greater for the added thoughts.  But they will not let any race stop the expansion of the Collective.  And with their unified mind and unprecedented leader it will take a collective effort to stop them.","tech_improvedStarDrive1.md":"A breakthrough in space propulsion, the nuclear star drive will allow your ships to travel 3 parsecs each turn.","tech_sanctionedSports.md":"The introduction of government sponsored sports will lift population morale by 20%.","race_isather.md":"Of all the sentient civilizations in the galaxy none are more unpredictable, violent, or naturally deadly than the Isather Dominion.  For thousands of years the species was divided into numerous tribes that were at constant war with each other. First evolving from pack hunters they are naturally extremely territorial and prone to solving all problems with maximum, brute force and terrifyingly violent finality.\n\nAfter their Industrial Revolution many individuals found they had a natural affinity for metallurgy, and astounding buildings, monuments and even cities sprung up almost overnight.  Unfortunately, the only successful cities to sprout up on their home world were populated by single tribes.  Any multiple tribal cities were destroyed down to the foundations as territorial rivalries and the smallest misunderstanding quickly sparked full-scale, tribe verse tribe wars in the streets.\n\nTheir tribal mentality would have fated them to never leave the planet, were it not for the need to unite and defend themselves when an alien fleet of slavers and strip miners descended on their world.  Millions of Isather were killed or enslaved overnight.  Desperate, the tribal leaders sought whatever resources they could find that would give them a chance against the invaders.\n\nOne such resource was Mortis Wretch, former leader of the Wretch Tribe, imprisoned for violating the Isather’s one shared Taboo: the slaughter of women and children.  Released from his sentence, Wretch resumed leadership of his tribe and turned his genocidal tendencies towards the invaders.  The invasion was over within a year.\n\nUniting under a common cause and a single flag for the first time in their violent history, the survivors formed the Isather Dominion.  The Dominion’s charter was to hunt down and destroy those who had brought death to their world.  Using their natural high strength and almost innate skills in metallurgy the Isather labored to create their own starships.\n\nAfter many years and many more failures their labors were finally successful.  As the first exploration fleet lifted off from the planet a sense of accomplishment washed over the population.  They had risen from the ashes.  They had reached the stars.  And soon they would have vengeance for the mass graves that covered their planet.","tech_roboticsFacility1.md":"Automated factories driven by advanced robotics, increasing industrial production by 10.","tech_roboticsFacility2.md":"Automated factories driven by advanced robotics, increasing industrial production by 20.","tech_orbitalBombardmentPackage.md":"Orbital bombardment is no simple matter; this package contains everything a ship needs in order to lay waste to the surface of a planet. May only be equipped by Cruiser class ships and above. Suffers a 2x stacking penalty to cost.","tech_exopolitics1.md":"Advances in leader management allows your empire to recruit up to three leaders.","unexplored_star11.md":"Class G stars are yellow in color. They are often surrounded by planets with moderate mineral resources and also capabale for supporting life. Dwarf stars are older and cooler with decreased likelihood of habitable planets.","tech_raiderLaunchBay.md":"A hanger bay which houses Raider fighter craft.","tech_improvedColonyInfrastructure2.md":"Advances in city planning provides additional space for more buildings. Increases maximum colony building lots by 4.","tech_protonTorpedo2.md":"Advancing in the torpedo's casing allow for a larger payload of protonic energy. Torpedos are heavily armored providing them with more resistance to point defense systems.","tech_efficientTaxCollection1.md":"Advances in government functions allow for reduced labor in collection taxes. Increases colony income by 2 galactic credits per turn.","tech_exopolitics2.md":"Further advances in leader management allows your empire to recruit up to five leaders.","unexplored_star12.md":"Class K stars have the best chance of containing habitable planets, but those planets are often poor in mineral resources. Dwarf stars are older and cooler with decreased likelihood of habitable planets.","tech_improvedFuelCells3.md":"Advances in zinnium cells can fuel your ships to destinations up to 14 parsecs away from the nearest friendly settlement.","tech_starbase3.md":"An orbital defense platform charged with defending the star system from enemy attack. Heals ships in the system by 30% of their total health each turn.","tech_improvedStarDrive2.md":"Additional refinements to the fission star drive will allow your ships to travel 5 parsecs each turn.","tech_bgeeepsBurrow2.md":"An orbital defense platform charged with defending the star system from enemy attack.","tech_bgeeepsBurrow.md":"An orbital defense platform charged with defending the star system from enemy attack.","tech_improvedEnergyController.md":"This controller doubles energy shield recharge rate by improving the effectiveness of the underlying energy relay systems on the ship. Limit one per ship.","tech_nuclearMissile3.md":"Advances in missile technology allow these missiles to carry heavier warheads, allowing more nuclear material to power the explosion. Nukes do bonus damage equal to 10% of ship current structure if they strike an unshielded target.","unexplored_star13.md":"Class M stars glare red and dim in the night sky. They have a poor chance of having planets with good environments or mineral resources. Dwarf stars are older and cooler with decreased likelihood of habitable planets.","tech_spaceElevator2.md":"Additional refinements on the elevator increase the efficiency of ship production. Decreases ship production cost by 20%.","race_serpent.md":"A nasty space serpent.","tech_advancedFarmingTechniques.md":"Increases food production by +1 per farmer","tech_energyShields3.md":"Advances in this technology allow for more incoming enemy munitions to be blocked. Limit one per ship.","tech_shipHullDestroyer.md":"Unlocks the ability to design and build destroyer class starships.","tech_starbase2.md":"An orbital defense platform charged with defending the star system from enemy attack. Heals ships in the system by 20% of their total health each turn.","tech_adv2ColonyShip.md":"Advances in cargo micromanagement allows for the creation of a more advanced colony. Requires one colonist to build.","tech_efficientFactories2.md":"Advanced factories which increase industrial production by +2 for each worker.","tech_plasmaTurret1.md":"Releases a ball of energy which expands and grows as it travels, the Plasma Turret is a very effective long range weapon.","tech_improvedFuelCells4.md":"Advances in anti-matter cells can fuel your ships to destinations up to 20 parsecs away from the nearest friendly settlement.","unexplored_star9.md":"Class A stars are typically bluish-white and are generally cooler than their blue bretheren. This increases the likelihood that these stars will have planets, although said planets will likely have harsh environmental conditions. Dwarf stars are older and cooler with decreased likelihood of habitable planets.","race_energy.md":"A nasty space energy.","race_human.md":"In 2114 A.D. Humanity nearly destroyed itself as years of self-destructive behavior, corruption, and incompetence created a global economic collapse.  Governments fell, people starved, and anarchy was more common than any semblance of peace and order.\n\nThe survivors eventually rallied, and a global Confederacy was formed.  First created out of rough and tumble city-states, which were mostly concerned with their own survival, the Confederacy seemed likely to fail.  To succeed it required diplomacy, ingenuity, and many black-operations that, officially, never happened.  Because of the sacrifice of many patriots the Confederacy first survived, then stabilized, and finally flourished.\n\nAfter the Confederacy stabilized its rule humanity regained faith in itself.  Calling upon a rich history of entrepreneurial spirit and tough-as-nails attitude the humans looked beyond their world to the riches of space, quickly colonizing their solar system.\n\nAs humanity’s influence expanded, so did the reach of their government.  Looking deeply into the lives of even the most common citizen, big government oversight and meddling bureaucracy spawned a breed of space smugglers.  These unique individuals developed many knacks and technologies to slip past any security or customs checkpoint the Confederacy could think of.  In short order many space captains earned well-over half their pay through “fun runs,” as smuggling operations became known.\n\nAfter colonizing their own backyard the human’s ingenuity carried them to new solar systems, and into direct conflict with other sentient civilizations.  While they first sought to peacefully coexist with their new neighbors, misunderstandings and diplomatic mistakes raised tensions.  Things only got worse when several space captains bungled simple “fun runs” and were discovered with highly illegal cargos.\n\nAfraid, but determined, the Confederacy braced itself for this new conflict, their courage bolstered by the presence of living legends such as Captain Jack Gentry and Colonel Hanifer.  Building new ships, training covert operatives, and capitalizing on its pilots smuggling skills, the Humans have prepared themselves to face any incoming threat with steely resolve, accurate fire, and silent knives in back rooms.  The fate of humanity hangs in the balance, and the Humans have never faced extinction quietly.","tech_interspeciesMedicalNetwork.md":"Your researchers will join a galaxy-wide network of doctors and scientists, curing diseases and increasing empire population growth proportional to your research production.","tech_pacifistsOverhaul1.md":"Provides an additional system slot to all hull designs in your empire.","unexplored_star8.md":"Class B stars very luminous, very energetic blue stars. Similar to class O stars, they tend to burn through their hydrogen very quicky and live for a relatively short period of time. Similar to class O stars, class B stars are unlikely to have many planets. Dwarf stars are older and cooler with decreased likelihood of habitable planets.","unexplored_star14.md":"Class O stars as very hot and extremely luminous, with most of their radiated output in the ultraviolet range. They are typically massive stars with very hot cores, burning through their hydrogen fuel very quickly. Class O stars are unlikely to have many planets at all, let alone habitable planets. Habitable planets in binary systems often take advantage of the increased radiation exposure to provide a more fertaile environment.","tech_improvedStarDrive3.md":"Using careful experimentation and exhaustive testing procedures, scientists can refine the star drive to the point that your ships can travel 7 parsecs each turn.","tech_reinforcedBulkheads2.md":"Advances in ship layout and design provide additional protection for key components, allowed for an effective increase in ship structure by 25% + 10 points. Suffers a 2x stacking penalty to cost.","unexplored_star7.md":"Class O stars as very hot and extremely luminous, with most of their radiated output in the ultraviolet range. They are typically massive stars with very hot cores, burning through their hydrogen fuel very quickly. Class O stars are unlikely to have many planets at all, let alone habitable planets. Dwarf stars are older and cooler with decreased likelihood of habitable planets.","tech_ionPulseCannon2.md":"Further alignment of the device allows for denser ionic particles in the stream, increasing the effectiveness. Damage to energy shields will induce an overload causing bonus structure damage to the target. Can only be equipped on Battleships, Titans, Mammoths, and Starbases.","race_uggathaaa.md":"The development of the amphibians of the **Uggathaaa Commune** is one to give even the most open-minded scientist fits. Evolving on an ocean world with very little dry land, the Frogs (as the other sentient races of the galaxy know them) do not fit into any preconceived theories or dogmas of science.\n\nNaturally at home in an ocean full of dangerous predators, the average **Uggathaaa** is either a master hunter or dead. Lacking traditional family units, all adult members of a given community gather twice annually to spawn a new generation.\n\nThe fertilized eggs from countless communities spread throughout the ocean before they hatching. Forced to learn or die, the hatchlings formed schools and used swarm tactics to survive, hunt, and create shelter. The survivors would eventually find their way to nearby communities as experienced wanders, where they are taught to be productive members of society.\n\nNatural chemists, the **Uggathaaa** society developed and advanced in unprecedented ways, all without the discovery of fire. Despite this enlightenment the **Uggathaaa** spent millennium stagnating on the bottom of their oceans, cycling through century-long periods of growth and decay until fate stepped in by way of a breathing mutation. This mutation stepped out on dry land, looked up at the stars, and questioned their existence.\n\nWith the questioned asked, the massive industry and scientific infrastructure of thousands of years quickly took them to the Void. With their quick breeding the Commune quickly spread among the stars, quickly making enemies with their aggressive expansion. Whether their swarm tactics can adapt to the void and dominate the ocean of the stars like those of the home world is anyone's guess.","tech_eesathuPulsar.md":"A pulse of unknown power that rips through nearby ships.","tech_laserBeam3.md":"Uranium atomic power sources allow this laser to reach maximum potency. A focused, intense beam of electromagnetic radiation is blasted at the target ship. Laser beams work especially well against energy shields and are often used in combination with weapons which are weak against shields.","unexplored_star6.md":"Class M stars glare red and dim in the night sky. They have a poor chance of having planets with good environments or mineral resources.","tech_reinforcedBulkheads1.md":"Lacing the ship's interior with additional reinforcements allow for it to withstand more destruction during combat, increasing the ships structure points by 15% + 5 points. Suffers a 2x stacking penalty to cost.","tech_researchCenter2.md":"A laboratory that increases research production +2 for each scientist.","tech_marineBarracks2.md":"# Marine Barracks 2\n\nProduces twice as many defensive ground troops, twice as fast.","tech_protonTorpedo1.md":"Space torpedos capable of delivering a large payload of explosive protonic energy. Torpedos are heavily armored providing them with more resistance to point defense systems.","tech_tradePort2.md":"An upgrade trade port increases colony income by 75%.","unexplored_star15.md":"Class B stars very luminous, very energetic blue stars. Similar to class O stars, they tend to burn through their hydrogen very quicky and live for a relatively short period of time. Similar to class O stars, class B stars are unlikely to have many planets. Habitable planets in binary systems often take advantage of the increased radiation exposure to provide a more fertaile environment.","unexplored_star5.md":"Class K stars have the best chance of containing habitable planets, but those planets are often poor in mineral resources.","race_taku.md":"When initially discovered by the Draske in 450.4, the T'Aku were described as \"illiterate hatchlings barely able to limp about in space\". The government was ill-equipped for the space age, and after the initial wonderment of discovery wore off the T'Aku began to discover just how behind they truly were. Growing discontent and fear spread amongst the population.\n\nA rash of extremist groups began to emerge, preaching that the T'Aku needed to evolve at all costs to ensure their survival in the intergalactic theater. One such group, the Sons of Evolution, managed to overthrow the government. Under the reign of this military junta the T'Aku began to focus their efforts on genetic manipulation and enhancements. With no morals and an overwhelming need to enhance their race the T'Aku quickly became an effective, if unstable, force to be reckoned with.","tech_starbase1.md":"An orbital defense platform charged with defending the star system from enemy attack. Heals ships in the system by 10% of their total health each turn.","tech_bgeeepsBurrow1.md":"An orbital defense platform charged with defending the star system from enemy attack.","unexplored_star4.md":"Class G stars are yellow in color. They are often surrounded by planets with moderate mineral resources and also capabale for supporting life.","tech_combatEngines.md":"Additional impulse engines provide an increase to the combat speed of the ship. Suffers a 2x stacking penalty to cost.","tech_hydroponicsCenter1.md":"Increases food production by +2.","tech_improvedStarDrive4.md":"An anti-matter powered star drive will allow your ships to travel 9 parsecs each turn.","tech_laserBeam2.md":"Advanced lens alignment provides increased efficiency to the laser. A focused, intense beam of electromagnetic radiation is blasted at the target ship. Laser beams work especially well against energy shields and are often used in combination with weapons which are weak against shields.","tech_pacifistsOverhaul2.md":"Provides an 